import React from 'react';
import './App.css';
import './../components/Card'
import SimpleCard from './../components/Card';
import bg from './../images/succulent_bg.jpg'

const App: React.FC = () => {
	return (
		<div className="App" style = {{backgroundImage: `url(${bg})`}} >
			<SimpleCard></SimpleCard>
		</div>
	);
}

export default App;
